import React from 'react';
import {Box, HStack, Text} from "@chakra-ui/react";

const ShareDialog = ({setVisible}) => {
    return (
        <>
            <Box bg={'gray.100'}
                 opacity={.8}
                 position={'fixed'}
                 top={0} minH={'100vh'}
                 right={0}
                 onClick={() =>setVisible(false)}
                 minW={'100vw'}
                 zIndex={900}>

            </Box>
            <Box w={500} bg={'white'}
                 transform={
                     'translate(50%,50%)'
                 }
                 position={'fixed'} top={'50%'} right={'50%'} height={800} zIndex={901}>
                <HStack>
                    <Text>Invite</Text>
                </HStack>
            </Box>
        </>
    );
};

export default ShareDialog;
